import { useEffect } from 'react';
import { connect } from 'react-redux';
import { compose } from 'redux';
import './App.css';
import { getConfigState } from './redux/config-reducer';
import { getDataState } from './redux/data-reducer';
import { getGameState } from './redux/gameState-reducer';

const App = (props) => {
  useEffect((props) => {
    props.getConfigState();
    props.getDataState();
    props.getGameState();
  }, []);
  return (
    <div className="App">

    </div>
  );
}

export default compose(connect(null, { getConfigState, getDataState, getGameState }))(App)
